import React from 'react';
import TeamInfo from '../../elements/teamInfo';

const Header = (props) => {

const teamInfo =(team) => {
  return team ?(
    <TeamInfo team={team}/>
  ): null
}
  return (
    <div>
      {teamInfo(props.teamData)}
      {postData(props.date)}
    </div>
  );
};

export default Header;
